import Layout from "../components/Layout"
const Weather = (props) => {
   return (

      <Layout>
         <div className="container">
            {props.date.time}
         </div>
      </Layout>

   );
}

Weather.getInitialProps = () => {
   const date = new Date().toDateString()
   return {
      date
   }
}

export default Weather;
